import React from "react";
import './filter.css'

const Filter = () => {
    return ( 
        <>
            <div className="filter-groups">
                <ul className="filter-group-list">
                    <li className="filter-group-list-item"></li>
                    <li className="filter-group-list-item"></li>
                    <li className="filter-group-list-item"></li>
                    <li className="filter-group-list-item"></li>
                    <li className="filter-group-list-item"></li>
                </ul>
            </div>
        </>
    );
}
 
export default Filter;
